// init
function init() {
    var menu = document.getElementById('slideout-menu'),
    x = 0, y = 0;

    // set initial bounds
    let menu_header = document.getElementById('slideout-menu-header');
    let menu_content = document.getElementById('slideout-menu-content');
    let menu_bounds = document.getElementById('slideout-menu-bounds');

    // set initial menu position to the height of the header
    menu.style.bottom = menu_bounds.style.bottom = (menu_header.clientHeight - menu.clientHeight) + 2 + 'px';

    // set bounds to header sizes
    // 1menuY + (1menuY - 1menuheaderY)
    menu_bounds.style.height = (menu.clientHeight + (menu.clientHeight - menu_header.clientHeight)) - 2 + "px";

    interact(menu)
    .draggable({
        startAxis: 'y',
        lockAxis: 'y',
        modifiers: [
            interact.modifiers.restrict({
                restriction: menu_bounds,
                elementRect: { top: 0, left: 0, bottom: 1, right: 1 }
            })
        ],
        inertia: true,
    })
    
    .on('dragmove', function (event) {
        x += event.dx;
        y += event.dy;

        // bounds

        event.target.style.webkitTransform =
        event.target.style.transform =
            'translate(' + x + 'px, ' + y + 'px)';
    })
}

window.addEventListener('load', init);